import React from 'react'



const fields = [
    [{}, {}, {}, {}],
    [{}, {}, {}, {}],
    [{}, {}, {}, {}],
    [{}, {}, {}, {}]
];

export default class Game extends React.Component {
    constructor(){
        super();
        this.state = {};
    }

    onNewGameClick = () => {
        this.props.history.push('/welcome');
    }

    onRestartClick = () => {
        this.props.history.push('/game');
    }

    generate(difficulty){
        const fields = []

        for (let i = 0; i < difficulty.length; i++) {
            fields[i] = [];
            for (let j = 0; j < difficulty.length; j++) {
                fields[i][j] = {
                    value: random(1, 8)
                }

            }
        }

        return fields
    }

    render(){
        return (
            <div className='game'>
               <header>
                   <div id='timer'>00:00:00.0</div>
                   <div className='counter'>0</div>
               </header>
               <div className='playField'>
               {this.state.fields.map((row, i) => row.map((fields, j) => (
                <div 
                x={i}
                y={j}
                value={fields.value}
                />
            )))}
               </div>
               <div>
                   <button type='submit' onClick={this.onRestartClick}>RESTART</button>
                   <button type='reset' onClick={this.onNewGameClick}>new game</button>
               </div>
            </div>
        );
    }
}
